import React from "react";
import {Link} from 'react-router-dom'
import {
  Button,
  Col,
  DropdownItem,
  DropdownMenu,
  DropdownToggle,
  Row,
  UncontrolledDropdown
} from "reactstrap";

import {Menu,Dropdown,Icon,Message} from 'antd'

import { Calendar, Filter, RefreshCw } from "react-feather";

/*   <Dropdown.Button overlay={menu}>
{props.project.project_title}
</Dropdown.Button> */

const menu = (
  <Menu >
    <Menu.Item key="1">

      1st menu item
    </Menu.Item>
    <Menu.Item key="2">

      2nd menu item
    </Menu.Item>
    <Menu.Item key="3">

      3rd item
    </Menu.Item>
  </Menu>
)

const ProjectHeader = ({props}) => {
  return (
    <Row className="mb-2 mb-xl-4">
      <Col xs="auto" className="d-none d-sm-block">
      <Dropdown.Button overlay={menu}>
      {props.project.project_title}
      </Dropdown.Button>
      </Col>

      <Col xs="auto" className="ml-auto text-right mt-n1">
        <UncontrolledDropdown className="d-inline mr-2">
          <DropdownToggle caret color="light" className="bg-white shadow-sm">
            <Calendar className="feather align-middle mt-n1" /> {props.account.subdomain}
          </DropdownToggle>
          <DropdownMenu left>
            <DropdownItem><Link to={`/${props.account.subdomain}/projects`}>Team Hub</Link></DropdownItem>
            <DropdownItem>Project List</DropdownItem>
          </DropdownMenu>
        </UncontrolledDropdown>

        {/*
        <Button color="primary" className="shadow-sm mr-1">
          <Filter className="feather" />
        </Button>
        <Button color="primary" className="shadow-sm">
          <RefreshCw className="feather" />
        </Button>*/}
      </Col>
    </Row>
  );
};

export default ProjectHeader;
